import React, {useState} from 'react'

function Books() {

    const [bookInput, setBookInput] = useState('')
    const placeholder = 'Enter the Name of the Book'
  return (
    <>
        <h1>Your Library</h1>
        <div>
            <input 
                type='text'
                value={bookInput}
                onChange={(e) => setBookInput(e.target.value)}
                placeholder={placeholder}
            />
            
        </div>
    </>
  )
}

export default Books
